import React, { Component } from 'react'

import LoveFramesApp from './AppComponent/LoveFramesApp';
import NaturePhotosApp from './AppComponent/NaturePhotosApp';
import SmartyMenJacket from './AppComponent/SmartyMenJacket';
import PicCollageMaker from './AppComponent/PicCollageMaker';
import WeddingDressApp from './AppComponent/WeddingDressApp';

export class DisplayData extends Component {
    constructor(props){
        super(props);

        this.state={}
    }

  render() {
    return (
        <div>
          <h3 className='overlining'><b><u>|====Displaying Data====|</u></b></h3>
        {
          this.props.triggerApp=== 'Love Photo Frames' && 
          <LoveFramesApp
            trigger={this.props.trigger} 
            setTrigger={this.props.setTrigger} 
            pic={this.props.pic} 
            setPic={this.props.setPic} 
            dataTrigger={this.props.dataTrigger}
            setDataTrigger={this.props.setDataTrigger}
          /> 
        }

        {
        this.props.triggerApp=== 'Nature Photo Editor' && 
          <NaturePhotosApp
            trigger={this.props.trigger} 
            setTrigger={this.props.setTrigger} 
            pic={this.props.pic} 
            setPic={this.props.setPic} 
            dataTrigger={this.props.dataTrigger}
            setDataTrigger={this.props.setDataTrigger}
          />
        }

        {
          this.props.triggerApp=== 'Smarty Men Jacket' && 
          <SmartyMenJacket
            trigger={this.props.trigger} 
            setTrigger={this.props.setTrigger} 
            pic={this.props.pic} 
            setPic={this.props.setPic} 
            dataTrigger={this.props.dataTrigger}
            setDataTrigger={this.props.setDataTrigger}
          />
        }

        {
          this.props.triggerApp=== 'Pic Collage Maker' && 
          <PicCollageMaker
            trigger={this.props.trigger} 
            setTrigger={this.props.setTrigger} 
            pic={this.props.pic} 
            setPic={this.props.setPic} 
            dataTrigger={this.props.dataTrigger}
            setDataTrigger={this.props.setDataTrigger}
          />
        }

        {
          this.props.triggerApp=== 'Wedding Dress Photo' && 
          <WeddingDressApp
            trigger={this.props.trigger} 
            setTrigger={this.props.setTrigger} 
            pic={this.props.pic} 
            setPic={this.props.setPic} 
            dataTrigger={this.props.dataTrigger}
            setDataTrigger={this.props.setDataTrigger}
          />
        }
     </div>
    )
  }
}

export default DisplayData
